 ('171', '201', 'en_us', 'Heated & Covered Patio ', '<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather.  Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, we\'ll still provide the views. The covered section of the patio bar is also available for private parties!  Please fill out the event request form below for more details.  </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather.  Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, we\'ll still provide the views. The covered section of the patio bar is also available for private parties!  Please fill out the event request form below for more details. </p>', '2017-03-15 21:58:20', '2019-10-30 20:47:07', '1c89e31d-cc39-48ed-bb6e-a626d0448209'),
 ('172', '202', 'en_us', 'Patio Seaplane', '<p>Enjoy unparalleled views of South Lake Union and sip a martini while watching Duck Dodge sailboat races.  Quaff a beer and watch the seaplanes land.  Or hangout by the fire and make some new friends!</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Enjoy unparalleled views of South Lake Union and sip a martini while watching Duck Dodge sailboat races.  Quaff a beer and watch the seaplanes land.  Or hangout by the fire and make some new friends!</p>', '2017-03-20 23:12:43', '2019-10-30 20:47:16', '8e56ac38-75a3-46fb-983d-6cc625315c3a'),
 ('174', '204', 'en_us', 'PRIVATE EVENT CLOSURE', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>We will be closed November 23rd, 2019 for a private event.  Our apologies for any inconvenience and we hope to see you all when business resumes on November 24th.  </p>', NULL, NULL, '2017-03-24 20:21:01', '2019-11-19 18:36:05', '9e190b07-9e71-46e7-a2f4-c12182056ad9'),
