 ('261', '296', 'en_us', 'Gilbert Cellars dinner at mbar!! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Join us on March 21st as Chef Jason Stratton prepares a 4 course meal to be paired with Yakima winery, Gilbert Cellars. $115 a person excluding tax &amp; gratuity. Seating is limited so call us to make a reservation or email at events@mbarseattle.com </p>', NULL, NULL, '2018-03-09 23:48:03', '2018-03-09 23:48:03', '0b439592-94d5-4ed9-a5fc-eb29ba9fc4cc'),
 ('262', '298', 'en_us', 'Patio is closed this evening Tuesday, March 13th due to the weather. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Join us again tomorrow! </p>', NULL, NULL, '2018-03-13 21:26:16', '2018-03-13 21:26:16', 'd397ea41-a7ff-4eb3-b0b3-36c0ec206b1c'),
 ('263', '299', 'en_us', 'Fairview Ave Road Closure ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Fairview Ave N will be closed from 03.30.2018 until 04.02.2018.  </p>\n<p>The 400 Fairview garage can still be easily accessed via an alleyway between Minor and Fairview using either Harrison or Republican.</p>\n<p>For any additional questions, please feel free to give us a call at 206.457.8287. </p>', NULL, NULL, '2018-03-23 18:55:42', '2018-03-23 22:20:07', '053e046b-9e45-4682-a061-cf0befcec315'),
 ('264', '300', 'en_us', 'Temporary Closure ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Due to unforeseen circumstances, mbar will be closed from 04.02.2018 to 04.04.2018. </p>\n<p>We apologize for any inconvenience this may cause, but look forward to seeing you again on Thursday 04.05.2018. </p>\n<p>Thank you! </p>', NULL, NULL, '2018-04-03 05:10:37', '2018-04-04 17:50:18', 'e08928b2-21f3-41aa-b8a3-9770602e74c6'),
