 ('307', '343', 'en_us', 'mbar presents: Nightmare on mbar\'s patio ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p><em><strong>mbar will be screening \'Nightmare On Elm Street\' on our heated and covered patio with  host Strawberry Shartcake! #joinus on Monday, October 21st from 8pm-Close for a fun &amp; scary evening. Free! </strong>Reservation are encouraged. </em></p>', NULL, NULL, '2018-08-29 20:27:26', '2019-10-18 20:07:22', '3c780987-c275-4b1e-b7f3-ba51f9c40965'),
 ('308', '344', 'en_us', 'mbar presents: Our annual NYE party!! BLACK & GOLD!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>*SOLD OUT* Book a table in our dining room for a beautiful four course prix-fixe dinner at $100 per person (excluding tax and gratuity). An early reservation will give you access to our fabulous party on the patio after your meal. Seatings begin at 6pm.<br /></p>\n<p>*SOLD OUT* The patio party starts at 8pm, with our favorite DJ\'s, complimentary mezze spread, a champagne toast and, of course, unparalleled views of the fireworks included in the $85 per person cover. Please note that the party on the patio is over 21 only, while minors are welcome in the dining room.</p>\n<p>Delicious food and spectacular cocktails will be available to purchase all night at this much loved celebration! **NOTE: The waitlist is now closed. Please join us the weekend before-Dec. 28th-30th for champagne flights &amp; DJ\'s all leading up to the NYE celebration! We look forward to seeing you in 2019!! </p>', NULL, NULL, '2018-09-04 22:30:58', '2019-10-07 21:32:01', '6223ae79-d2be-4bd3-afb2-34fb5ae207a7'),
 ('310', '346', 'en_us', 'Billecart-Salmon Dinner ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#joinus on Wednesday, September 26th at 7pm as we present a very special dinner with Billecart-Salmon at mbar. From our kitchen, at the hands of Chef Jason Stratton, a not-to-be-missed four course meal will be paired with exquisite champagnes from the house of Billecart-Salmon. Tickets for this evening are $150 excluding tax and gratuity. Space is limited so to make your reservation please call us at (206) 457-8287 or email us at <a href=\"mailto:events@mbarseattle.com\">events@mbarseattle.com</a>. A credit card will be used to secure the reservation and there will be a cancelation fee of 72 hours. See you at the table!!<br /></p>', NULL, NULL, '2018-09-18 22:14:13', '2018-09-24 19:35:21', '6275c7a4-7fb6-4afb-9016-80222ae43f42'),
