 ('237', '55', '9', '1', 'en_us', '2', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Interior Dining Room Views\",\"slug\":\"slide-1\",\"postDate\":1488683460,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"1\":\"<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill. &nbsp;Relax and enjoy the sunset early in the evening, or spend the twilight hours dining &nbsp;while encompassed by twinkling stars and city lights.<\\/p>\",\"21\":[\"51\"]}}', '2017-04-06 18:28:00', '2017-04-06 18:28:00', '3ddf07f9-26d3-4c51-98a0-049791ea1fc0'),
 ('238', '201', '9', '1', 'en_us', '3', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Rainbow Chair\",\"slug\":\"rainbow-chair\",\"postDate\":1489615080,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"1\":\"<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather. &nbsp;Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, the swinging rainbow egg will always be one of the most coveted seats in house. &nbsp;The covered section of the patio bar is also available for private parties! &nbsp;Please fill out the event request form below for more details. &nbsp;<em>*insider tip* - if you\'re still feeling a little chilly, we have a selection of handcrafted quilts by local artist, Joey Veltkamp, to keep you cozy.<\\/em><\\/p>\",\"21\":[\"191\"]}}', '2017-04-06 18:34:26', '2017-04-06 18:34:26', 'a00763e7-1579-4b9f-96af-b53f9e24f7e5'),
