 ('414', '55', '9', '1', 'en_us', '3', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Interior Dining Room Views\",\"slug\":\"slide-1\",\"postDate\":1488683460,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill. &nbsp;Relax and enjoy the sunset early in the evening, or spend the twilight hours dining &nbsp;while encompassed by twinkling stars and city lights.<\\/p>\",\"1\":\"<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill. &nbsp;Relax and enjoy the sunset early in the evening, or spend the twilight hours dining &nbsp;while encompassed by twinkling stars and city lights.<\\/p>\",\"21\":[\"51\"]}}', '2017-06-11 16:52:34', '2017-06-11 16:52:34', '99729b23-0fbb-4b97-adce-a5e385f202ca'),
 ('415', '201', '9', '1', 'en_us', '6', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Rainbow Chair\",\"slug\":\"rainbow-chair\",\"postDate\":1489615080,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather. &nbsp;Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, the swinging rainbow egg will always be one of the most coveted seats in house. &nbsp;The covered section of the patio bar is also available for private parties! &nbsp;Please fill out the event request form below for more details. &nbsp;<em>*insider tip* - if you\'re still feeling a little chilly, we have a selection of handcrafted quilts by local artist, Joey Veltkamp, to keep you cozy.<\\/em><\\/p>\",\"1\":\"<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather. &nbsp;Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, the swinging rainbow egg will always be one of the most coveted seats in house. &nbsp;The covered section of the patio bar is also available for private parties! &nbsp;Please fill out the event request form below for more details. &nbsp;<em>*insider tip* - if you\'re still feeling a little chilly, we have a selection of handcrafted quilts by local artist, Joey Veltkamp, to keep you cozy.<\\/em><\\/p>\",\"21\":[\"234\"]}}', '2017-06-11 16:52:44', '2017-06-11 16:52:44', '92a16c49-4d6e-47df-a705-85e258144266'),
