 ('1114', '355', '17', '1', 'en_us', '2', '', '{\"typeId\":\"17\",\"authorId\":\"1\",\"title\":\"mbar will be closed on January 27th\",\"slug\":\"mbar-will-be-closed-on-january-27th\",\"postDate\":1546992000,\"expiryDate\":1548687600,\"enabled\":1,\"parentId\":null,\"fields\":{\"33\":\"<p>In celebration of our employee holiday party. We look forward to seeing you soon. <\\/p>\"}}', '2019-01-24 21:26:04', '2019-01-24 21:26:04', '959cb109-ca4e-49c9-9af4-64d5d5997777'),
 ('1116', '55', '9', '1', 'en_us', '4', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Interior Dining Room Views\",\"slug\":\"slide-1\",\"postDate\":1488683460,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill. &nbsp;Relax and enjoy the sunset early in the evening, or spend the twilight hours dining &nbsp;while encompassed by twinkling stars and city lights.<\\/p>\",\"1\":\"<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill. &nbsp;Relax and enjoy the sunset early in the evening, or spend the twilight hours dining &nbsp;while encompassed by twinkling stars and city lights.<\\/p>\",\"21\":[\"51\"]}}', '2019-01-24 21:33:02', '2019-01-24 21:33:02', 'e25fc4cd-cdd7-40a1-a51e-40871af57307'),
 ('1117', '201', '9', '1', 'en_us', '7', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Rainbow Chair\",\"slug\":\"rainbow-chair\",\"postDate\":1489615080,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather. &nbsp;Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, the swinging rainbow egg will always be one of the most coveted seats in house. &nbsp;The covered section of the patio bar is also available for private parties! &nbsp;Please fill out the event request form below for more details. &nbsp;<em>*insider tip* - if you\'re still feeling a little chilly, we have a selection of handcrafted quilts by local artist, Joey Veltkamp, to keep you cozy.<\\/em><\\/p>\",\"1\":\"<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather. &nbsp;Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, the swinging rainbow egg will always be one of the most coveted seats in house. &nbsp;The covered section of the patio bar is also available for private parties! &nbsp;Please fill out the event request form below for more details. &nbsp;<em>*insider tip* - if you\'re still feeling a little chilly, we have a selection of handcrafted quilts by local artist, Joey Veltkamp, to keep you cozy.<\\/em><\\/p>\",\"21\":[\"234\"]}}', '2019-01-24 21:33:24', '2019-01-24 21:33:24', '56af40a8-811a-4dc2-aba7-187438781186'),
 ('1118', '202', '9', '1', 'en_us', '5', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Patio Seaplane\",\"slug\":\"patio-shot\",\"postDate\":1490051520,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Enjoy unparalleled views of South Lake Union and sip a martini while watching Duck Dodge sailboat races. &nbsp;Quaff a beer and watch the seaplanes land. &nbsp;Or hangout by the fire and make some new friends!<\\/p>\",\"1\":\"<p>Enjoy unparalleled views of South Lake Union and sip a martini while watching Duck Dodge sailboat races. &nbsp;Quaff a beer and watch the seaplanes land. &nbsp;Or hangout by the fire and make some new friends!<\\/p>\",\"21\":[\"235\"]}}', '2019-01-24 21:33:32', '2019-01-24 21:33:32', '0b097edd-d5a9-46bd-ae37-3fc7b17e9a45'),
