 ('1146', '89', '15', '1', 'en_us', '13', '', '{\"typeId\":\"15\",\"authorId\":\"1\",\"title\":\"Racha Haroun - Owner\",\"slug\":\"racha\",\"postDate\":1488736740,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"1\":\"\",\"21\":[\"38\"],\"34\":\"Racha Haroun was born in London, England to a Syrian father and Iranian mother. Racha came with her family to Houston, Texas from Damascus in 1982 where she attended college and met her husband Wassef. Racha grew up in a household where hospitality was prized and where both cuisines and palates were equally valued and integrated. Racha is deeply involved in the cultural community of Seattle and is a crucial part of the palate, menu development, and creative process behind the mamnoon aesthetic.\"}}', '2019-02-15 01:53:26', '2019-02-15 01:53:26', '314111f4-75c1-42fe-b5ec-d0b30f3fd7ca'),
