 ('1222', '201', '9', '1', 'en_us', '8', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Rainbow Chair\",\"slug\":\"rainbow-chair\",\"postDate\":1489615080,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather. &nbsp;Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, the swinging rainbow egg will always be one of the most coveted seats in house. &nbsp;The covered section of the patio bar is also available for private parties! &nbsp;Please fill out the event request form below for more details. &nbsp;<em>*insider tip* - if you\'re still feeling a little chilly, we have a selection of handcrafted quilts by local artist, Joey Veltkamp, to keep you cozy.<\\/em><\\/p>\",\"1\":\"<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather. &nbsp;Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, the swinging rainbow egg will always be one of the most coveted seats in house. &nbsp;The covered section of the patio bar is also available for private parties! &nbsp;Please fill out the event request form below for more details. &nbsp;<em>*insider tip* - if you\'re still feeling a little chilly, we have a selection of handcrafted quilts by local artist, Joey Veltkamp, to keep you cozy.<\\/em><\\/p>\",\"21\":[\"234\",\"49\"]}}', '2019-04-08 19:56:09', '2019-04-08 19:56:09', 'f4040d90-7098-4aab-8116-b99f449bc30d'),
 ('1223', '55', '9', '1', 'en_us', '5', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Interior Dining Room Views\",\"slug\":\"slide-1\",\"postDate\":1488683460,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill. &nbsp;Relax and enjoy the sunset early in the evening, or spend the twilight hours dining &nbsp;while encompassed by twinkling stars and city lights.<\\/p>\",\"1\":\"<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill. &nbsp;Relax and enjoy the sunset early in the evening, or spend the twilight hours dining &nbsp;while encompassed by twinkling stars and city lights.<\\/p>\",\"21\":[\"51\"]}}', '2019-04-08 19:57:25', '2019-04-08 19:57:25', 'b1fe8e36-d014-4a58-a003-1f4274faa95a'),
 ('1224', '201', '9', '1', 'en_us', '9', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Rainbow Chair\",\"slug\":\"rainbow-chair\",\"postDate\":1489615080,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather. &nbsp;Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, the swinging rainbow egg will always be one of the most coveted seats in house. &nbsp;The covered section of the patio bar is also available for private parties! &nbsp;Please fill out the event request form below for more details. &nbsp;<em>*insider tip* - if you\'re still feeling a little chilly, we have a selection of handcrafted quilts by local artist, Joey Veltkamp, to keep you cozy.<\\/em><\\/p>\",\"1\":\"<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather. &nbsp;Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, the swinging rainbow egg will always be one of the most coveted seats in house. &nbsp;The covered section of the patio bar is also available for private parties! &nbsp;Please fill out the event request form below for more details. &nbsp;<em>*insider tip* - if you\'re still feeling a little chilly, we have a selection of handcrafted quilts by local artist, Joey Veltkamp, to keep you cozy.<\\/em><\\/p>\",\"21\":[\"234\"]}}', '2019-04-08 19:57:36', '2019-04-08 19:57:36', 'bd9cc923-d730-400e-9a57-c8138a4406e6'),
 ('1225', '202', '9', '1', 'en_us', '6', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Patio Seaplane\",\"slug\":\"patio-shot\",\"postDate\":1490051520,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Enjoy unparalleled views of South Lake Union and sip a martini while watching Duck Dodge sailboat races. &nbsp;Quaff a beer and watch the seaplanes land. &nbsp;Or hangout by the fire and make some new friends!<\\/p>\",\"1\":\"<p>Enjoy unparalleled views of South Lake Union and sip a martini while watching Duck Dodge sailboat races. &nbsp;Quaff a beer and watch the seaplanes land. &nbsp;Or hangout by the fire and make some new friends!<\\/p>\",\"21\":[\"235\"]}}', '2019-04-08 19:57:45', '2019-04-08 19:57:45', '44433d4e-59bc-4c70-a229-b5dae7a70937'),
 ('1226', '55', '9', '1', 'en_us', '6', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Interior Dining Room Views\",\"slug\":\"slide-1\",\"postDate\":1488683460,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill. &nbsp;Relax and enjoy the sunset early in the evening, or spend the twilight hours dining &nbsp;while encompassed by twinkling stars and city lights.<\\/p>\",\"1\":\"<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill. &nbsp;Relax and enjoy the sunset early in the evening, or spend the twilight hours dining &nbsp;while encompassed by twinkling stars and city lights.<\\/p>\",\"21\":[\"378\"]}}', '2019-04-08 19:58:40', '2019-04-08 19:58:40', 'de7afb02-2af5-4238-b6de-170f42d326f1'),
