 ('1246', '92', '15', '1', 'en_us', '14', '', '{\"typeId\":\"15\",\"authorId\":\"1\",\"title\":\"Eric Zimmerman - Assistant Manager\",\"slug\":\"eric\",\"postDate\":1488868980,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"1\":\"\",\"21\":[\"384\"],\"34\":\"Eric@mbarseattle.com\\r\\n\"}}', '2019-04-08 21:13:21', '2019-04-08 21:13:21', 'c7a69943-28a3-400e-aec7-d38441b43b17'),
