 ('1251', '88', '15', '1', 'en_us', '17', '', '{\"typeId\":\"15\",\"authorId\":\"1\",\"title\":\"Wassef Haroun - Owner\",\"slug\":\"wassef\",\"postDate\":1488736680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"1\":\"\",\"21\":[\"391\"],\"34\":\"Wassef Haroun was born in Syria and raised in Lebanon before moving to the United States for school. After leaving a career in technology and computer science, Wassef turned to mamnoon as an experiment to bring the food and traditions of the levant to an American audience and to bridge the apparent gaps between the two cultures he inhabits. True to his geek background, Wassef has his hands in innumerable projects, big and small, around the restaurant in order to make the mamnoon experience universally compelling.\"}}', '2019-04-09 06:31:25', '2019-04-09 06:31:25', 'ebb9878d-913b-4c16-afa0-447b634ffd1d'),
 ('1252', '89', '15', '1', 'en_us', '14', '', '{\"typeId\":\"15\",\"authorId\":\"1\",\"title\":\"Racha Haroun - Owner\",\"slug\":\"racha\",\"postDate\":1488736740,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"1\":\"\",\"21\":[\"392\"],\"34\":\"Racha Haroun was born in London, England to a Syrian father and Iranian mother. Racha came with her family to Houston, Texas from Damascus in 1982 where she attended college and met her husband Wassef. Racha grew up in a household where hospitality was prized and where both cuisines and palates were equally valued and integrated. Racha is deeply involved in the cultural community of Seattle and is a crucial part of the palate, menu development, and creative process behind the mamnoon aesthetic.\"}}', '2019-04-09 06:31:57', '2019-04-09 06:31:57', '187400f9-a2aa-4de3-84e4-cee9b160273a'),
 ('1253', '88', '15', '1', 'en_us', '18', '', '{\"typeId\":\"15\",\"authorId\":\"1\",\"title\":\"Wassef Haroun - Owner\",\"slug\":\"wassef\",\"postDate\":1488736680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"1\":\"\",\"21\":[\"393\"],\"34\":\"Wassef Haroun was born in Syria and raised in Lebanon before moving to the United States for school. After leaving a career in technology and computer science, Wassef turned to mamnoon as an experiment to bring the food and traditions of the levant to an American audience and to bridge the apparent gaps between the two cultures he inhabits. True to his geek background, Wassef has his hands in innumerable projects, big and small, around the restaurant in order to make the mamnoon experience universally compelling.\"}}', '2019-04-09 06:40:11', '2019-04-09 06:40:11', '259e8a40-4109-47d1-86e5-be1d1dce7b69'),
