 ('1367', '55', '9', '1', 'en_us', '7', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Interior Dining Room Views\",\"slug\":\"slide-1\",\"postDate\":1488683460,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill. &nbsp;Relax and enjoy the sunset early in the evening, or spend the twilight hours dining &nbsp;while encompassed by twinkling stars and city lights.<\\/p>\",\"1\":\"<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill. &nbsp;Relax and enjoy the sunset early in the evening, or spend the twilight hours dining &nbsp;while encompassed by twinkling stars and city lights.<\\/p>\",\"21\":[\"378\"]}}', '2019-06-04 17:01:14', '2019-06-04 17:01:14', '6b3a2f14-883c-47d7-8f83-4b5f033d5b0b'),
 ('1368', '201', '9', '1', 'en_us', '12', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Heated & Covered Patio \",\"slug\":\"rainbow-chair\",\"postDate\":1489615080,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather. &nbsp;Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, we\'ll still provide the views. The covered section of the patio bar is also available for private parties! &nbsp;Please fill out the event request form below for more details.&nbsp;<\\/p>\",\"1\":\"<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather. &nbsp;Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, we\'ll still provide the views. The covered section of the patio bar is also available for private parties! &nbsp;Please fill out the event request form below for more details. &nbsp;<\\/p>\",\"21\":[\"381\"]}}', '2019-06-04 17:01:27', '2019-06-04 17:01:27', 'c7bdbb0d-cbf0-477e-8f1c-3710a8db68fb'),
