 ('1387', '327', '17', '1', 'en_us', '2', '', '{\"typeId\":\"17\",\"authorId\":\"1\",\"title\":\"mbar presents: Our 3rd annual Gay Pride Celebration! \",\"slug\":\"mbar-presents-lets-rock-a-three-day-pride-celebration\",\"postDate\":1560535200,\"expiryDate\":1561793400,\"enabled\":1,\"parentId\":null,\"fields\":{\"33\":\"<p>mbar is thrilled to announce their 3rd Annual Pride Party: PRIDE IN THE SKY, June 28, $10, 4pm- midnight. This event is in partnership with Absolut Vodka & Alternative Pride. Oh what?! Ice luge, Jell-O shots, plus DJ RIZ and DJ Slaven Slaven on the decks. Join mbar in celebrating PRIDE IN THE SKY where everyone will cut loose and party for love. Purchase tickets directly down below.&nbsp;#joinus #spreadthelove<br><\\/p>\\r\\n\"}}', '2019-06-14 16:29:10', '2019-06-14 16:29:10', 'b42c290f-1ed9-475d-b1e1-848b4f74e858'),
 ('1388', '333', '17', '1', 'en_us', '2', '', '{\"typeId\":\"17\",\"authorId\":\"1\",\"title\":\"mbar presents: Our 3rd annual 4th of July celebration!\",\"slug\":\"mbar-presents-our-2nd-annual-4th-of-july-celebration\",\"postDate\":1560538800,\"expiryDate\":1530777600,\"enabled\":1,\"parentId\":null,\"fields\":{\"33\":\"<p><em><i>Best vibes & best views! Join us on our rooftop patio&nbsp;at&nbsp;<span class=\\\"m_5472686503505358046gmail-aBn\\\">7pm<\\/span>&nbsp;for unrivaled views of South Lake Union\\u2019s fireworks display, Chef Jason Stratton\\u2019s Levantine mezze buffet, and DJ\'s setting the beat. But wait... did we mention THE VIEW?! Our fire pits will be turned up to keep us warm on a cool summer night while we all huddle together to drink up the epic firework show. Speaking of drinks, tasty cocktails and wines will be flowing all night at our bar. Tickets are priced at $125 per ticket excluding tax and fees, and includes entrance and buffet.<\\/i><\\/em><\\/p>\\r\\n<p><em><i>Seattle, we\\u2019ll be partying rain or shine. Refunds will be honored up to 7 days before the day of the event in case something prevents you attending. Seating is first come, first serve. Party is 21+<\\/i><\\/em><\\/p>\"}}', '2019-06-14 16:34:41', '2019-06-14 16:34:41', '13832570-57d5-40af-b3dd-449fe1dc3b89'),
