 ('1497', '201', '9', '1', 'en_us', '13', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Heated & Covered Patio \",\"slug\":\"rainbow-chair\",\"postDate\":1489615080,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather. &nbsp;Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, we\'ll still provide the views. The covered section of the patio bar is also available for private parties! &nbsp;Please fill out the event request form below for more details.&nbsp;<\\/p>\",\"1\":\"<p>Our heated and covered section of the patio makes for a fantastic outdoor experience no matter the weather. &nbsp;Whether it\'s raining sideways and thirty-five degrees, or blue skies and sunshine, we\'ll still provide the views. The covered section of the patio bar is also available for private parties! &nbsp;Please fill out the event request form below for more details. &nbsp;<\\/p>\",\"21\":[\"381\"]}}', '2019-09-20 21:51:15', '2019-09-20 21:51:15', 'e0eab26d-e862-4a0e-a926-a45bfc810bef'),
 ('1498', '55', '9', '1', 'en_us', '8', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Interior Dining Room Views\",\"slug\":\"slide-1\",\"postDate\":1488683460,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill. &nbsp;Relax and enjoy the sunset early in the evening, or spend the twilight hours dining &nbsp;while encompassed by twinkling stars and city lights.<\\/p>\",\"1\":\"<p>Our dining room and interior bar overlook downtown Seattle, MoPop and Seattle Center, the Olympic Mountain Range, Queen Anne Hill, South Lake Union, and North Capitol Hill. &nbsp;Relax and enjoy the sunset early in the evening, or spend the twilight hours dining &nbsp;while encompassed by twinkling stars and city lights.<\\/p>\",\"21\":[\"378\"]}}', '2019-09-20 21:51:24', '2019-09-20 21:51:24', 'edd27656-377f-43b6-860d-89e795c77eea'),
 ('1499', '202', '9', '1', 'en_us', '8', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Patio Seaplane\",\"slug\":\"patio-shot\",\"postDate\":1490051520,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"36\":\"<p>Enjoy unparalleled views of South Lake Union and sip a martini while watching Duck Dodge sailboat races. &nbsp;Quaff a beer and watch the seaplanes land. &nbsp;Or hangout by the fire and make some new friends!<\\/p>\",\"1\":\"<p>Enjoy unparalleled views of South Lake Union and sip a martini while watching Duck Dodge sailboat races. &nbsp;Quaff a beer and watch the seaplanes land. &nbsp;Or hangout by the fire and make some new friends!<\\/p>\",\"21\":[\"235\"]}}', '2019-09-20 21:51:33', '2019-09-20 21:51:33', '884081f1-d066-4f7e-9125-59d505a8bbf5'),
