 ('1516', '333', '17', '1', 'en_us', '14', '', '{\"typeId\":\"17\",\"authorId\":\"1\",\"title\":\"mbar presents: Our 3rd Annual 4th of July Celebration!\",\"slug\":\"mbar-presents-our-2nd-annual-4th-of-july-celebration\",\"postDate\":1560884400,\"expiryDate\":1562313600,\"enabled\":1,\"parentId\":null,\"fields\":{\"33\":\"<p><em>Join us on our rooftop patio starting at&nbsp;7pm&nbsp;for South Lake Union\\u2019s fireworks display!Tickets are priced at $125 per ticket excluding tax, and includes entrance and complimentary&nbsp;mezze buffet.<\\/em><em><em>&nbsp;Seating is first come, first serve. Party is 21+ and ends after the fireworks display. Tickets will not be sold at the door.&nbsp;<\\/em><\\/em><\\/p>\"}}', '2019-10-07 21:30:53', '2019-10-07 21:30:53', '47c08bbe-808f-48e1-8dc8-38b4356c4b28'),
