 ('1518', '204', '17', '1', 'en_us', '52', '', '{\"typeId\":\"17\",\"authorId\":\"1\",\"title\":\"PRIVATE EVENT CLOSURE\",\"slug\":\"timed-announcement\",\"postDate\":1559599200,\"expiryDate\":1559808000,\"enabled\":1,\"parentId\":null,\"fields\":{\"33\":\"<p>We will be closed June 5th, 2019 for a private event. &nbsp;Apologies for any inconvenience and we hope to see you all when business resumes on June 6th.&nbsp;&nbsp;<\\/p>\"}}', '2019-10-07 21:31:36', '2019-10-07 21:31:36', '20bb8ee5-3fc4-4e0d-8ea4-4f509b1441b9'),
 ('1519', '344', '17', '1', 'en_us', '11', '', '{\"typeId\":\"17\",\"authorId\":\"1\",\"title\":\"mbar presents: Our annual NYE party!! BLACK & GOLD!\",\"slug\":\"out-to-the-ball-game\",\"postDate\":1542756600,\"expiryDate\":1546336800,\"enabled\":1,\"parentId\":null,\"fields\":{\"33\":\"<p>*SOLD OUT* Book a table in our dining room for a beautiful four course prix-fixe dinner at $100 per person (excluding tax and gratuity). An early reservation will give you access to our fabulous party on the patio after your meal. Seatings begin at 6pm.<br><\\/p>\\r\\n<p>*SOLD OUT* The patio party starts at 8pm, with our favorite DJ\'s, complimentary mezze spread, a champagne toast and, of course, unparalleled views of the fireworks included in the $85 per person cover. Please note that the party on the patio is over 21 only, while minors are welcome in the dining room.<\\/p>\\r\\n<p>Delicious food and spectacular cocktails will be available to purchase all night at this much loved celebration! **NOTE: The waitlist is now closed. Please join us the weekend before-Dec. 28th-30th for champagne flights & DJ\'s all leading up to the NYE celebration! We look forward to seeing you in 2019!!&nbsp;<\\/p>\"}}', '2019-10-07 21:32:01', '2019-10-07 21:32:01', 'e5415a33-0fab-4b47-a4a7-05d9fb8199c4'),
